// frontend/src/components/AssetDetails.js

import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container,
  Paper,
  Typography,
  Grid,
  TextField,
  Button,
} from '@mui/material';

const AssetDetails = ({ currentUser }) => {
  const [asset, setAsset] = useState(null);

  useEffect(() => {
    const fetchAsset = async () => {
      try {
        const res = await axios.get(`http://localhost:5000/api/assets/${id}`);
        setAsset(res.data);
      } catch (error) {
        console.error('Ошибка загрузки актива:', error);
      }
    };

    if (currentUser) {
      fetchAsset();
    }
  }, [currentUser]);

  return (
    <Container maxWidth="md">
      <Paper elevation={3} style={{ padding: '20px' }}>
        <Typography variant="h5" gutterBottom>{asset?.name}</Typography>

        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField
              label="Серийный номер"
              name="serial_number"
              value={asset?.serial_number || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Инвентарный номер"
              name="inventory_number"
              value={asset?.inventory_number || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Наименование"
              name="name"
              value={asset?.name || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Местоположение"
              name="location"
              value={asset?.location || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
          </Grid>
          <Grid item xs={6}>
            <TextField
              label="Ответственный"
              name="responsible_person"
              value={asset?.responsible_person || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Фактический пользователь"
              name="actual_user"
              value={asset?.actual_user || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
            <TextField
              label="Комментарии"
              name="comments"
              value={asset?.comments || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              multiline
              rows={4}
              margin="normal"
            />
            <TextField
              label="Статус"
              name="status_id"
              value={asset?.status_id || ''}
              disabled={!currentUser || currentUser.role !== 'admin'}
              fullWidth
              margin="normal"
            />
          </Grid>
        </Grid>

        {/* QR-код */}
        <Box mt={3} display="flex" justifyContent="center">
          <div id="qrcode">
            <QRCodeSVG
              value={asset?.inventory_number || 'IT-Актив'}
              size={200}
              bgColor="#ffffff"
              fgColor="#000000"
              level="H"
            />
          </div>
        </Box>

        {/* Кнопки управления */}
        <Box mt={3} display="flex" justifyContent="space-between">
          <Button variant="outlined" onClick={() => history.goBack()}>
            Назад к списку
          </Button>

          {currentUser && currentUser.role === 'admin' && (
            <Button variant="contained" color="success">
              Сохранить изменения
            </Button>
          )}
        </Box>
      </Paper>
    </Container>
  );
};

export default AssetDetails;
